CREATE DEFINER=`root`@`localhost` PROCEDURE `consultarOfertaCompleta` (IN `entrada` VARCHAR(45))  BEGIN
SET @consulta =CONCAT('select * from oferta as O 
inner join oferta_tiene_ubicacion as otu 
on (O.idOferta = otu.Oferta_idOferta) 
inner join ubicacion as u 
on (otu.Ubicacion_idUbicacion = u.idUbicacion)
inner join ciudad as ci 
on (u.ciudad = ci.idCiudad)
inner join detalleproducto as dp
on (dp.Oferta_idOferta = O.idOferta)
inner join producto as P
on (dp.Producto_idProducto = P.idProducto)
inner join marca as M
on (M.idMarca = P.Marca_idMarca)
inner join categoria as C
on (C.idCategoria = P.Categoria_idCategoria)
inner join detalleproducto_tiene_imagen as dpti
on (dp.Oferta_idOferta = dpti.DetalleProducto_Oferta_idOferta)
inner join imagen as I
on (dpti.Imagen_idImagen = idImagen) where O.nombreOferta like ''%',entrada,'%''');
PREPARE ejecutar FROM @consulta;
EXECUTE ejecutar;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `consultarOfertaCompletaPorIdOferta` (IN `entrada` INT(11))  BEGIN
SET @consulta = CONCAT('select * from oferta as O 
inner join oferta_tiene_ubicacion as otu 
on (O.idOferta = otu.Oferta_idOferta) 
inner join ubicacion as u 
on (otu.Ubicacion_idUbicacion = u.idUbicacion)
inner join ciudad as ci 
on (u.ciudad = ci.idCiudad)
inner join detalleproducto as dp
on (dp.Oferta_idOferta = O.idOferta)
inner join producto as P
on (dp.Producto_idProducto = P.idProducto)
inner join marca as M
on (M.idMarca = P.Marca_idMarca)
inner join categoria as C
on (C.idCategoria = P.Categoria_idCategoria)
inner join detalleproducto_tiene_imagen as dpti
on (dp.Oferta_idOferta = dpti.DetalleProducto_Oferta_idOferta)
inner join imagen as I
on (dpti.Imagen_idImagen = idImagen) where O.idOferta = ',entrada,'');
PREPARE ejecutar FROM @consulta;
EXECUTE ejecutar;
END$$

