CREATE TABLE `calificacion` (
  `idCalificacion` int(11) NOT NULL COMMENT 'Clave primaria de la tabla',
  `idUsuario` int(11) DEFAULT NULL COMMENT 'Id del usuario que registra la calificación.',
  `idOferta` int(11) DEFAULT NULL COMMENT 'Id de la oferta calificada por el usuario.',
  `puntosPrecio` int(11) DEFAULT NULL COMMENT 'Puntos asignados por satisfacción en el precio de la oferta, van del 1 al 5.',
  `puntosCalidad` int(11) DEFAULT NULL COMMENT 'Puntos asignados por satisfacción en la calidad del producto de la oferta, van del 1 al 5.',
  `resumen` varchar(45) DEFAULT NULL COMMENT 'Resumen de la opinión expresada por el usuario.',
  `opinion` varchar(200) DEFAULT NULL COMMENT 'Opinión del usuario con respecto a la oferta, expresada en unos cuantos párrafos.'
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='Tabla en la que se guardan las calificaciones que hacen los usuarios de cada oferta en cuanto a precio y calidad, que van desde 1 hasta 5 y agregan un resumen y una opinion sobre la oferta en palabras.';

